import React from 'react'

export default class LocationDetails extends React.Component {
  constructor(props){
    super(props);
  }


  render() {
    return (
      <div style={{height:'300px'}}className="location-details-container">
        <h1>Anabel anabel anabe;</h1>
        <button onClick={this.props.detailsToggle}>Close</button>
      </div>
    )
  }
}
